import React, { Component } from "react";
import "./Experience.css";

class Experience extends Component {
  render() {
    return (
      <div id="exp_container">
        <h1>Experience</h1>
        <div class="row">
          <div class="col-md-4">
          </div>
          <div class="col-md-8">
          </div>
        </div>
        <div class="row">
          <div class="col-md-12">
          </div>
        </div>
      </div>
    );
  }
}

export default Experience;
